    <div className="main">
      <div className="container">
         <div className="news">
          <img src="/Ima" alt=""  width={420}/>
          <h1>Arun News</h1>
         </div>
         <div className="calendar"></div>
         <img src="../Images/arunNews.png" alt="" />
          <h1>Arun Calendar</h1>
      </div>

    </div>
  );
};

export default Home;
